abstract:
Die Karte Theatrum Belli Rhenani zeigt das Kriegsgebiet am Rhein zwischen Bodensee und Koblenz zur Zeit des Spanischen Erbfolgekrieges in den Jahren 1702-1713.;
Das farbige Kartenwerk umfasst 20 Kartenblätter im Maßstab 1:110.000. Die Kartenblätter sind nach Westen ausgerichtet. Dieses "Rheinische Kriegstheater" wurde von dem in kaiserlichen Diensten stehenden Militärkartografen Cyriakus Blödner gefertigt.
Die Darstellung von Reichstadt, Schloß, Flecken, Dorf, Weiler, Müller, Reichsposten., Kapellen, Kloster, Bistum, Weingebieten und vielem mehr, illustriert diese Epoche auf eine sehr anschauliche Art. Weiterhin wird der Kriegsverlauf des Feldzuges während des Jahres 1713 geschildert. Mit Nummern und Textzeilen werden in den Karten auf die Stellungen und Bewegungen der kaiserlich-deutschen und französischen Truppenteile verwiesen.
